import { dateFilter } from '@/filters/date.filters'
import { CONTRACT_TYPE } from '@/constants/setting/contract'
import moment from 'moment'
import { UserService } from '@/services/user.service'
export default {
  props: {
    info: {
      type: Object,
      default: () => ({})
    },
    codeDemo: {
      type: String,
      default: ''
    },
    lawContent: {
      type: String,
      default: ''
    }
  },
  bem: {
    b: 'contract-preview'
  },
  serviceInject() {
    return {
      userService: UserService
    }
  },
  rxState() {
    return {
      brand: this.userService.brand$
    }
  },
  filters: { dateFilter },
  data() {
    return {
      CONTRACT_TYPE,
      today: moment()
    }
  },
  computed: {
    showAllTh() {
      switch (this.info.contract_type) {
        case CONTRACT_TYPE.MEMBER_CARD:
        case CONTRACT_TYPE.PERSONAL:
        case CONTRACT_TYPE.PACKAGE:
        case CONTRACT_TYPE.CABINET:
        case CONTRACT_TYPE.DEPOSITE:
          return true
        default:
          return false
      }
    },
    showSomeTh() {
      switch (this.info.contract_type) {
        case CONTRACT_TYPE.MONEY:
          return true
        default:
          return false
      }
    },
    showSmallCourseTh() {
      switch (this.info.contract_type) {
        case CONTRACT_TYPE.SMALL_COURSE:
          return true
        default:
          return false
      }
    }
  }
}
